.form_inner {
  position: relative;
}
.form_inner h3 {
  position: relative;
  margin-top: 0;
  color: white;
  font-family: 'Roboto', sans-serif;
  font-weight: 300;
  font-size: 26px;
  text-transform: uppercase;
}
.form_inner h3:after {
  content: '';
  position: absolute;
  left: 0;
  bottom: -6px;
  height: 2px;
  width: 60px;
  background: #1762ee;
}
.form_inner label {
  display: block;
  padding-left: 15px;
  font-family: 'Roboto', sans-serif;
  color: rgb(23 98 238);
  text-transform: uppercase;
  font-size: 14px;
}
.form_inner input {
  display: block;
  width: 100%;
  margin: 10px 0 15px;
  border-width: 0;
  line-height: 40px;
  border-radius: 20px;
  outline: none;
  color: rgb(0, 0, 0);
  font-family: 'Roboto', sans-serif;
}
.form_inner input[type='checkbox'] {
  position: absolute;
  opacity: 0;
}
#custom_checkbox + label {
  position: relative;
  margin: 20px 0;
  text-transform: none;
  cursor: pointer;
}
#custom_checkbox + label:before {
  content: '';
  display: inline-block;
  width: 20px;
  height: 20px;
  margin-right: 10px;
  vertical-align: text-top;
  background: rgb(255, 255, 255);
}
#custom_checkbox:checked + label:before {
  background: #1762ee;
}
#custom_checkbox:checked + label:after {
  content: '';
  position: absolute;
  width: 2px;
  height: 2px;
  left: 20px;
  top: 9px;
  background: white;
  box-shadow: 2px 0 0 white, 4px 0 0 white, 4px -2px 0 white, 4px -4px 0 white,
    4px -6px 0 white, 4px -8px 0 white;
  transform: rotate(45deg);
}

